webpackJsonp([0xd23fbfc1deac],{582:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Return of the Shadow"}},markdownRemark:{id:"/home/kvalencik/git/rots-site/src/pages/news/001662.md absPath of file >>> MarkdownRemark",html:"<blockquote>\n<p>Message 1662 : Sat Jul  1 (Lowtheim)   :: 7-1-2017 World Patch Notes</p>\n</blockquote>\n<p>The guards at the Fiddlers’ Inn looked at each other uncomfortably as they\nheard a noise outside the door. As they cautiously opened the door they gasped\nat the shirtless body laying in on the gravel road. The corpse of a young man\nhad been carefully placed on the ground, the word ‘REPENT’ carved into his\nchest. In the dusk, they could just barely see the form of a red robed man\nfading into the dusk, heading south.</p>\n<p>New zone intended for 3-5 legends and will require some effort/luck to get in.\nThanks to Neil for original concept, build, mob and quest design.\nThanks to Pat for updated concept, build, quest design, and wonderful descriptions.\nThis project originally started 7 years ago, and I’m glad it’s in.</p>\n<p>Other stuff:\n‘Mail’ alias added to more armor\nDark black shield key fixed\nVinny tombs keys fixed\nHigh level tames tweaked slightly (bears more hits/cats faster/etc)\nArrow slightly adjusted\nMisc minor fixes</p>",frontmatter:{title:"News 1662: 7-1-2017 World Patch Notes",date:"October 09, 2017"}}},pathContext:{path:"/news/1662"}}}});
